import React from 'react';
import { Routes, Route } from 'react-router-dom'; // Import Routes and Route
import Resume from './pages/Resume'; // Import your components


function App() {
  return (
    <div className="App">
      {/* Routes must be used inside a BrowserRouter (already done in index.js) */}
      <Routes>
        {/* Set up different routes */}
        <Route path="/" element={<Resume />} />  {/* Default route */}
        <Route path="/resume" element={<Resume />} />
      </Routes>
    </div>
  );
}

export default App;
